import React from "react";
import { useHistory } from "react-router-dom";
import crash from '../image/crash.png';
import roulette from '../image/rullete.jpg';
import raffle from '../image/loterie.webp';


function Home() {

  const history = useHistory();

  const handleClick = () => {
    history.push("/crash");
  };

  return (
    
    <div >
        <div class="pagesGame">
          <div class="poza1" onClick={handleClick}></div>
          <div class="poza2"></div>
          <div class="poza3"></div>
        
      </div>
    </div>
  );
}

export default Home;
